import React from "react";
import "./index.scss";

const ClearanceFactors = ({ texts }) => {
    return (
        <div className="clearance-factors-noAuth">
            <h2>Fatores de afastamento</h2>
            <p className="desc-profiler">{texts.fatores_afastamento.texto}</p>
        </div>
    );
};

export default ClearanceFactors;
